import React from 'react';

function App() {
  return (
    <div className="text-center">
      <header className="bg-blue-500 p-6 text-white">
        <h1 className="text-4xl">Welcome to React with Tailwind CSS</h1>
      </header>
      <main className="p-4">
        <p className="text-lg">
          This is a simple example of a React application styled with Tailwind CSS.
        </p>
      </main>
    </div>
  );
}

export default App;
